      "id": 2855,
      "name": "Aerial Combat of WW1",
      "nameLength": "small",
      "imageUrl": "",
      "pumpType": "",
      "nsfw": false,
      "subtype": "2nd",
      "tags": [],
      "description": "The War To End All Wars was one of the first conflicts to make major use of planes and other Aerial crafts, be it huge Zeppelins or even small weather balloons. Being the main introduction to a new era of warfare, WW1 had plenty of Aerial conflicts, but it's quite hard to pinpoint specific aerial battles, unlike the war's sequel. ",
