      "pumpType": "",
      "nsfw": false,
      "subtype": "2nd",
      "tags": [],
      "description": "Lying in the Lowlands, the Kingdom of Kouderhagen is a large nation. It's capital, Kouderstad, is on a large island off the coast of the Lowlands, and it controls the remnants of both the Dutch and Belgian homelands, and lays claim to being the ancestors of the two.",
