      "name": "Union of the Stales (the remnants of the United Kingdom)",
      "nameLength": "small",
      "imageUrl": "",
      "pumpType": "",
      "nsfw": false,
      "subtype": "2nd",
      "tags": [],
      "description": "The Union of the Stales is a high population density, and advanced nation, in the remnants of England. It's capital, the rebuilt London, is the center of the nation, and the core of its national identity. While they are the remnants of England, the northern remnants of England and Scotland remain uninhabitable and submerged due to the Lost War.",
