      "nameLength": "small",
      "imageUrl": "",
      "pumpType": "",
      "nsfw": false,
      "subtype": "2nd",
      "tags": [],
      "description": "A trading republic with on the North Sea, and in control of the Kiel Canal. The capital of the Flanspublic is Oldenburg, and claim independence from the Helige Empire. It consists of most of the North-West German Coast, and tends to show its economic prowess across the Baltic, and North Sea.",
