      "nameLength": "small",
      "imageUrl": "",
      "pumpType": "",
      "nsfw": false,
      "subtype": "2nd",
      "tags": [],
      "description": "The Second Battle of Ypres was fought from 22 April \u2013 25 May 1915 for control of the strategic Flemish town of Ypres in west Belgium. The Second Battle of Ypres was the first mass use by Germany of poison gas on the Western Front. Other Battles of Ypres included:\n\nThe First Battle of Ypres took place 19 October \u2013 22 November 1914\nThe Fifth Battle of Ypres took place 28 September \u2013 2 October 1918",
