      "nameLength": "small",
      "imageUrl": "",
      "pumpType": "",
      "nsfw": false,
      "subtype": "2nd",
      "tags": [],
      "description": "The battle of Verdun was a brutal, long lasting conflict between the French Third Republic and the German Empire that lasted from the 21 February to 18 December 1916. The battle was the longest battle of not only WW1, but all of history! \nThe battle was initiated by the Germans, who planned to capture the Meuse Heights, a position with good observation for artillery-fire on Verdun.",
