      "imageUrl": "",
      "pumpType": "",
      "nsfw": false,
      "subtype": "2nd",
      "tags": [],
      "description": "The Battle of Messines (7\u201314 June 1917) was an attack by the British Second Army on the Western Front near the village of Messines in West Flanders, Belgium. The battle is famous for it's mine detonation, placed under the German positions. This was probably the largest planned explosion in history until the 1945 Trinity atomic weapon test.",
