      "pumpType": "",
      "nsfw": false,
      "subtype": "2nd",
      "tags": [],
      "description": "The Meuse - Argonne Offensive was a major part of the final Allied offensive of World War I that stretched along the entire Western Front. It lasted from the 26th September to the 11th November 1918. The battle ended when the war did, as the Germans sign an armistice with the Entente.\n\nThe Meuse - Argonne Offensive is the second bloodiest battle in the United State's history.",
