      "description": "By 1916, half a year since the Italian declaration of war against the Austro - Hungarians, the Italians suffered repulsion and thus the Austro - Hungarians found themselves victorious in all five battles of the Isonzo.\n\nAustria - Hungary had their own plans for a Trentino offensive, and had launched it by the 15th of May, 1916",
