      "nsfw": false,
      "subtype": "2nd",
      "tags": [],
      "description": "The 1917 Battle of Caporetto (Battle of Kobarid) was a battle that took place near the town of Karfreit, Austria - Hungary (Present day Kobarid, Slovenia). Austro-Hungarian forces, reinforced by German units, were able to break into the Italian front line and rout the Italian forces opposing them.\nThe battle lasted from the 24 October to 19 November 1917.",
