      "subtype": "2nd",
      "tags": [],
      "description": "The Battle of Vittorio Veneto was the final Italian push against the already crumbling Austria - Hungary, starting from the 24 October 1918, the first anniversary of the Battle of Caporetto. Unlike that battle, though, the Italians scored a major victory on the Austro - Hungarians with a few British, French and American allies, and contributed to the end of WW1. ",
