      "pumpType": "",
      "nsfw": false,
      "subtype": "2nd",
      "tags": [],
      "description": "At the onset of WW1, at the 26th of July, 1914, the Kingdom of Italy, despite being a part of the Triple Alliance, remained neutral, claiming that the alliance was a defensive one. Also, Italy had their eyes set on the Austro - Hungarian lands of Tyrol and Littoral, which had a majority Italian population at the time. \nOn May 23rd, 1915, they declared war on Austria and joined the Entente.",
