      "tags": [],
      "description": "The Battle of Cer was a military campaign fought between Austria-Hungary and Serbia in August 1914. Austria - Hungary, who originally became the catalyst of the war by declaring war on Serbia, saw the country as a weak enemy, and expected them to be gone by the year's end.\nAt the battle of Cer, the first major battle between Serbia and Austria - Hungary lead to a surprising Serbian victory.",
