      "description": "The Kosovo Offensive was an offensive launched as a part of the greater Serbian campaign of World War I. The ultimate goal of the offensive was to encircle and destroy the remnants of the Serbian army.\nBy this time, not only were the Austro - Hungarians, along with German support fighting the routed Serbians, but Bulgaria had also joined as a Central Power, and had a major impact on the battle.",
