      "nsfw": false,
      "subtype": "2nd",
      "tags": [],
      "description": "The Battle of Mojkovac was a World War I battle fought between 6 January and 7 January 1916 near Mojkovac. The Montenegrin army was ordered to cover the retreat of the Serbs on their way to the Greek island of Corfu via their lands. \nDespite their size, under - equipped-ness and manpower, the Montenegrin army caused significant casualties to Austria - Hungary, and halted their advance.",
