      "description": "The Battle of the Crna Bend was a major military engagement fought between the forces of the Central Powers and the Entente in May 1917. It was part of the Allied Spring Offensive of the same year that was designed to break the stalemate on the Macedonian Front.\nDespite being outnumbered and out - gunned, the Germans and Bulgarians fended off the Entente.",
