      "description": "The Third Battle of Doiran started on the 18 September 1918, with the Greeks and the British attacking the positions of the Bulgarian First Army near Dojran Lake. This operation was an attempt to capitulate Bulgaria, ending the Macedonian front.\n\nThe Bulgarians successfully defended their position, but the British and Greeks found their positions abandoned upon advancing once more.",
