      "description": "(The Suez Canal defines the border between Africa and Asia, so this option could've been in the Middle - Eastern front as well.)\n\nThe Suez Canal was completed and opened by Britain in 1869, connecting the Mediterranean to the Red Sea. There were times in history that the Canal became subject to battles, and 1915 was the time which the Ottomans tried to attack and disrupt the Canal. ",
