      "nsfw": false,
      "subtype": "2nd",
      "tags": [],
      "description": "France, whilst not known as much for it's Aerial contributions as they are for their Army's or even Navy, they were still a key player in the war of the skies in WW1. Famous French planes of this era include the Nieuport 24, and the Caudron G.4. They also had their share of aces, such as Ren\u00e9 Fonck, the 'Allied aces of aces', and Georges Guynemer, with an impressive Fifty Four victories.",
