      "nameLength": "small",
      "imageUrl": "",
      "pumpType": "",
      "nsfw": false,
      "subtype": "2nd",
      "tags": [],
      "description": "The Tsardom of Bulgaria had capitalised on the weakened Serbians back in the fall of 1915, joining WW1 against them. However, after constant attritional warfare against the Entente, the writing was on the wall for the Central Powers in late 1918.\n\nThe Bulgarians successfully defeated a British and Greek assault on the 18th of September near Lake Dojran, but surrendered two weeks later.",
