      "description": "The Sikorsky S-16 was a Russian equi-span single-bay two-seat biplane designed by Igor Sikorsky in 1914-1915. The Plane was one of the first to adapt a synchronisation gear for it's forward facing gun. The plane was armed with one .30-06 Springfield Vickers Machine Gun to allow effective combat against enemy planes.",
